-- ----------------------------
DROP TABLE IF EXISTS `cashcredit_receipt`;
CREATE TABLE `cashcredit_receipt` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `receiptId` varchar(36) CHARACTER SET utf8 NOT NULL COMMENT '借据Id',
  `userId` varchar(30) CHARACTER SET utf8 NOT NULL,
  `status` varchar(2) CHARACTER SET utf8 DEFAULT '00' COMMENT '借据状态，00：初始，01：成功：02：失败',
  `applyTime` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '申请时间',
  `borrowAmount` decimal(10,2) NOT NULL COMMENT '借款金额',
  `period` int(3) NOT NULL COMMENT '借款期数',
  `bindId` varchar(18) CHARACTER SET utf8 DEFAULT '' COMMENT '绑卡卡号',
  `consumeType` varchar(20) CHARACTER SET utf8 DEFAULT '0' COMMENT '借款用途',
  `repaymentType` bigint(20) DEFAULT '0' COMMENT '还款方式',
  `interestPerDay` decimal(18,2) DEFAULT NULL COMMENT '日利率',
  `startTime` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '借款开始日期',
  `endTime` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '借款结束日期',
  `repaymentDay` varchar(20) CHARACTER SET utf8 DEFAULT '' COMMENT '还款日',
  `firstRepayment` decimal(10,2) DEFAULT NULL,
  `repaymentAccount` varchar(18) CHARACTER SET utf8 DEFAULT '' COMMENT '还款账户',
  `borrower` varchar(20) CHARACTER SET utf8 DEFAULT '' COMMENT '借款人姓名',
  `borrowerIdNo` varchar(18) CHARACTER SET utf8 DEFAULT '' COMMENT '身份证号',
  `tid` varchar(36) CHARACTER SET utf8 DEFAULT '' COMMENT 'tid',
  `bankName` varchar(18) CHARACTER SET utf8 DEFAULT '' COMMENT '开户行',
  PRIMARY KEY (`id`),
  UNIQUE KEY `receipt_unique` (`receiptId`) USING BTREE,
  KEY `receipt_query` (`userId`,`status`,`receiptId`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=latin1;

