-- ----------------------------
-- Table structure for product
-- ----------------------------
DROP TABLE IF EXISTS `product`;
CREATE TABLE `product` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `PRODUCT_ID` bigint(32) NOT NULL DEFAULT '0' COMMENT '产品id',
  `PRODUCT_NAME` varchar(120) DEFAULT NULL,
  `PRODUCT_CODE` varchar(12) NOT NULL DEFAULT 'N' COMMENT '产品CODE',
  `PRODUCT_STATUS` int(11) NOT NULL DEFAULT '0' COMMENT '产品状态',
  `ACCOUNT_TYPE` int(2) NOT NULL DEFAULT '0' COMMENT '账户类型1贷款2信用',
  `MIN_AMOUNT` bigint(20) NOT NULL DEFAULT '0' COMMENT '产品支持的最小额度',
  `MAX_AMOUNT` bigint(20) NOT NULL DEFAULT '0' COMMENT '产品支持的最大额度',
  `CREATED` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `MODIFIED` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '修改时间',
  `LIMIT_CYCLE` int(11) DEFAULT '0' COMMENT '产品额度是否循环 0:非循环;1:循环产品',
  `IS_DEL` int(4) DEFAULT '0',
  `IS_PROJECT_SHARED` int(4) DEFAULT '0',
  `IS_PUBLIC_PAY` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否用于对公放款',
  `MANNUL_PAY` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否用于手工单',
  `LOAN_ORDER_PAY` tinyint(4) DEFAULT '0' COMMENT '是否参与贷款订单放款：0不参与，1参与',
  `REFUND_PAY_OVERFLOW` int(11) NOT NULL DEFAULT '2' COMMENT '控制退款产生的溢缴款哪个阶段打款，1，只要产生溢缴款，则不校验退款订单的状态。2，需要校验退款订单的状态。',
  `OP_OWNER` varchar(255) DEFAULT NULL,
  `OVER_FLOW_ORDER_PAY` int(4) DEFAULT '0' COMMENT '参与溢缴款线上线下控制（0不参与，1参与）',
  `PRODUCT_STATUS_DQM` varchar(2) NOT NULL DEFAULT '8' COMMENT '数据质量管理的产品状态码值；1-产品创意阶段；2-产品立项阶段；3-产品研发阶段；4-产品暂不推出；5-已审批产品；6-可交付市场产品；7-交付暂停产品；8-已发布产品；9-产品试销；10-暂停销售',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `PRODUCT_ID` (`PRODUCT_ID`),
  KEY `IDX_PRODUCT_CODE` (`PRODUCT_CODE`),
  KEY `idx_idname` (`PRODUCT_ID`,`PRODUCT_NAME`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='产品表';

-- ----------------------------
-- Records of product
-- ----------------------------

