-- Table structure for project_product_rule
-- ----------------------------
DROP TABLE IF EXISTS `project_product_rule`;
CREATE TABLE `project_product_rule` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `PROJECT_ID` bigint(32) NOT NULL DEFAULT '0' COMMENT '项目id',
  `PROJECT_CODE` varchar(50) NOT NULL DEFAULT 'N' COMMENT '产品CODE',
  `CORE_NO` int(2) NOT NULL DEFAULT '0' COMMENT '核心服务提供商编号：1自有核心，2',
  `CORE_PRODUCT_NO` varchar(50) NOT NULL DEFAULT '0' COMMENT '核心产品序号',
  `CORE_REPAY_MODE_ID` bigint(20) NOT NULL DEFAULT '0' COMMENT '还款方式ID，关联息费模块还款方式表(核心带过来，不可编辑)',
  `PREPAY_RULE_IND` int(11) NOT NULL DEFAULT '0' COMMENT '当前记录是否为提前还款时的产品规则的指示：1是，2否',
  `CORE_CYCLE_TYPE` int(11) NOT NULL DEFAULT '0' COMMENT '分期类型(核心带过来，不可编辑)',
  `CORE_CYCLE_COUNT` int(11) NOT NULL DEFAULT '0' COMMENT '分期期数(核心带过来，不可编辑)',
  `CORE_DESCRIPTION` varchar(300) NOT NULL DEFAULT 'N' COMMENT '描述(核心带过来，不可编辑)',
  `CORE_BILL_DAY_RULE` int(11) NOT NULL DEFAULT '0' COMMENT '账单日规则：1每月最后一天，2指定日期(核心带过来，不可编辑)',
  `CORE_BILL_DAY` int(11) NOT NULL DEFAULT '0' COMMENT '还款日(核心带过来，不可编辑)',
  `CORE_REPAY_DAY` int(11) NOT NULL DEFAULT '0' COMMENT '还款日(核心带过来，不可编辑)',
  `CORE_REPAY_DAY_RULE` int(11) NOT NULL DEFAULT '0' COMMENT '还款日规则：1指定日期，2放款申请日(核心带过来，不可编辑)',
  `CREATED` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `MODIFIED` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '修改时间',
  `IS_DEL` int(4) DEFAULT '0',
  `PRODUCT_CODE` varchar(12) NOT NULL DEFAULT 'N' COMMENT '项目code,用于默认息费规则',
  PRIMARY KEY (`id`),
  KEY `IDX_CORE_PRODUCT_NO` (`CORE_PRODUCT_NO`,`CORE_CYCLE_COUNT`),
  KEY `IDX_PROJECT_CODE` (`PROJECT_CODE`),
  KEY `idx_PROJECT_ID` (`PROJECT_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='项目核心规则关联表';

