  `VALID_AMOUNT` bigint(20) DEFAULT NULL COMMENT '可用额度',
  `USER_STATUS` int(11) DEFAULT NULL COMMENT '用户状态 0 无效 1 有效',
  `MODIFIED` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COMMENT='用户信息表';

