INSERT INTO `cashcredit_agreement` VALUES ('1', '百信银行个人银行账户服务协议', '<h1 style=\"text-align: center;\">百信银行个人银行账户服务协议</h1>\n<p>客户：简称&ldquo;您&rdquo;或&ldquo;本人&rdquo;；</p>\n<p>中信百信银行股份有限公司：简称&ldquo;百信银行&rdquo;。</p>\n<p>客户自愿申请开立百信银行个人银行账户，为明确双方的权利和义务，维护双方的合法权益，特签订本服务协议。</p>\n<h2 style=\"text-align: center;\">第一条 开户申请</h2>\n<p>1.客户通过百信银行客户服务渠道申请开户，经百信银行核准后为客户开立个人银行账户。百信银行客户服务渠道是指百信银行自有渠道(如：百信银行客户端、官方网站、公众号等)及第三方机构合作渠道，包括但不限于电子渠道。</p>\n<p><strong>2.</strong><strong>客户申请开立个人银行账户时所设定的绑定手机号码、绑定账户等，必须是客户本人合法获得且真实有效的，并处于客户有效掌控下。因客户变更绑定手机号码、遗失绑定账户，或将绑定手机号码、绑定账户，转借、转租他人使用，或因客户原因造成的资料及交易信息等泄露所产生的风险及损失，由客户自行承担。百信银行向客户绑定手机发送信息即视为通知送达。</strong></p>\n<p><strong>3.</strong><strong>客户办理转账、产品交易等业务须使用交易密码，凭交易密码对个人银行账户进行的操作均视为客户本人所为。客户应妥善保管银行账号、交易密码等个人资料，不得将账户转借、转租他人使用。因客户将账户转借、转租他人使用或泄露资料所产生的风险及全部损失，由客户自行承担。</strong></p>\n<h2 style=\"text-align: center;\">第二条 业务须知</h2>\n<p>1.开户</p>\n<p>1.1</p>\n<p>1.2账户分类：个人银行账户根据账户申请渠道、身份信息校验方式及风险等级等的不同，分为I类银行账户、II类银行账户和III类银行账户(以下分别简称I类户、II类户和III类户)，各类个人银行账户分别拥有不同的账户功能。</p>\n<p>1.2.1通过柜面或现场等渠道受理的，经规定认可的存款人身份校验方式，校验客户身份后，开立的账户为I类户。I类户的功能主要包括：存款、购买投资理财等金融产品、转账、消费及缴费支付、支取现金等。客户开立I类户后，百信银行将为该账户开通以上业务功能，客户可使用该账户办理同名账户转账、非同名账户转账、消费、缴费及现金支取等业务。<strong>客户办理转账及现金收付等业务时应当遵守人民币银行结算账户的有关管理规定。</strong></p>\n<p><strong>上述业务及功能的开通时间、申请渠道及服务范围等由百信银行根据自身业务开展情况决定。</strong></p>\n<p>1.2.2通过电子等渠道受理，并绑定了开户申请人的同名I类户的，开立的账户为II类户。II类户的账户功能主要包括：办理存款、购买投资理财等金融产品、向绑定账户转账、限定金额向非绑定账户的转账服务、限定金额的消费及缴费支付服务。</p>\n<p>绑定账户：客户可绑定在他行开立的同名个人银行账户，将账户内的资金转出。绑定账户应是客户本人以实名制开立且真实持有的有效I类户。</p>\n<p>绑定方式：客户设置绑定账户后，百信银行将通过合法安全的渠道对客户绑定账户的信息进行验证(包括但不限于打款验证或客户身份基本信息交叉验证等方式)，经验证通过后账户绑定成功。</p>\n<p>解除绑定；客户可登录百信银行的客户服务渠道(包括但不限于电子渠道)，按照操作指引完成验证后，解除绑定关系。若客户取消绑定后，还需再次重新绑定，可以按本协议约定的绑定方式重新绑定。<strong>对于客户已开立的II类户，百信银行按规定对客户身份信息进行进一步核验后，可将其转为I类户。</strong></p>\n<p>1.2.3通过电子等渠道受理的，并通过客户同名I类户转入任意金额方式验证并激活的，开立的账户为III类户。III类户的账户功能主要包括：限定金额的消费及缴费服务。</p>\n<p><strong>对于客户已开立的III类户。百信银行按规定对存款人身份信息进行进一步核验后，可将其转为I类户或II类户。</strong></p>\n<p><strong>&nbsp;</strong></p>\n<p><strong>百信银行根据客户的账户申请渠道、身份核验方式及风险等级等，为客户开立对应类别的个人银行账户，确定不同的账户功能、业务范围及交易限额，增减所需客户信息、验证步骤及具体要求，并对个人银行账户进行分类和动态管理。</strong></p>\n<p>&nbsp;</p>\n<p>2.转账限额</p>\n<p><strong>百信银行在为客户开通非柜面转账业务时，会约定非柜面渠道向非同名账户转账的日累计限额、笔数和年累计限额等，具体标准参考百信银行客户服务渠道的相关公告或提示。客户可通过百信银行客户服务渠道自助查询并管理转账限额。任何情况下，客户设置的限额不应超过百信银行设置的最大限额，如实际支付金额大于支付限额，百信银行有权拒绝执行交易指令。百信银行保留根据业务发展需要设置或修改最大转账限额的权利。</strong></p>\n<p>&nbsp;</p>\n<p>3.绑定手机号码</p>\n<p>是指客户在申请开立个人银行账户时设定的，包括但不限于接收由百信银行发送的各种动态码、交易提醒短信等信息，必要时百信银行客服人员可通过此手机号码向客户核实身份信息和交易信息。每个个人银行账户，仅有一个绑定手机号码。</p>\n<p>&nbsp;</p>\n<p>4.</p>\n<p>客户办理个人银行账户销户后个人银行账户内资金本息将自动转回至绑定账户或客户指定的他行同名账户，请销户前确保收款账户为有效账户，否则资金将无法正常到账，百信银行对此不承担责任。</p>\n<p>&nbsp;</p>\n<p>5.变更密码</p>\n<p>客户需登录个人银行账户修改账户交易密码；若客户遗忘账户交易密码，客户需登录个人银行账户提交交易密码重置申请，按提示流程操作，通过提示的身份认证手段后即可在线重置交易密码。</p>\n<p>&nbsp;</p>\n<p>6.变更绑定手机号码</p>\n<p>客户需变更绑定手机号码时，需由客户登录个人银行账户提交申请，按提示流程操作，通过提示的身份认证手段后完成绑定手机号码变更。</p>\n<p>&nbsp;</p>\n<p>7.不动户、零余额账户处置方法</p>\n<p>客户个人银行账户自开户之日的次日（待激活的为激活之日）起6个月内无客户主动发起的交易记录（账户查询、银行计息等除外）的账户，百信银行将予以暂停非柜面服务，客户可通过重新核实身份后启用服务。对于一年(含)以上来发生收付活动(不包括结计利息、收取账户管理费等非客户主动发起的款项收支)且未欠百信银行债务的II、III类不动户、零余额账户，百信银行将予以转长期不动户处理。</p>\n<p>&nbsp;</p>\n<p><strong>8.</strong><strong>客户同意百信银行可应环境安全等级及所办理业务的情况，针对不同客户采取不同的信息采集及身份验证步骤。</strong></p>\n<p>&nbsp;</p>\n<h2 style=\"text-align: center;\">第三条 双方的权利及义务</h2>\n<p>1.个人银行账户持有人必须是具有完全民事行为能力的自然人，客户自愿申请开立个人银行账户，并承诺申请个人银行账户时具有完全民事行为能力。</p>\n<p>2.客户自愿申请开立个人银行账户，同意遵守国家有关金融法律法规、政策及百信银行的有关业务规章制度。客户应按百信银行的有关规定支付各种结算和服务费用。</p>\n<p><strong>3.</strong><strong>客户保证向百信银行提供的开户证件符合《个人存款账户实名制规定》的要求，客户保证向百信银行提供的所有申请资料准确、真实、有效、合法，并保证由客户本人办理，不得由他人代办。如客户提供的资料不符合要求或存在代办、冒充他人申请等情形，百信银行有权拒绝客户申请，对于已经开立了个人银行账户的，百信银行有权提前单方终止本协议。客户开户资料发生变更时，应按本协议及时办理变更手续。</strong></p>\n<p><strong>4.</strong><strong>若百信银行发现客户在非安全、存在欺诈风险的情况下操作账户，百信银行有权增加核实客户身份的措施，以保障客户权益，增加措施包括但不限于：要求客户进行生物识别验证、输入动态密码、补充相关个人信息或提供个人身份证明信息等。若客户存在可疑交易且无法解释交易的合理性时，百信银行有权对其该笔交易采取限制措施。</strong></p>\n<p><strong><u>若百信银行怀疑或认为任何账户的收支款项是恐怖分子/恐怖组织的财产或资金、或是毒品交易、恐怖活动或任何犯罪的收入、或者该等汇款或支付可能另行受到任何司法管辖区的制裁，百信银行可以根据法律、法规和该司法管辖区的政府和监管机关的要求，全权决定并采取百信银行认为适当的任何行动。该等行为包括但不限于：拦截和调查任何付款指标以及通过百信银行的系统发往客户或由客户发出或代表发出的其他信息或通讯；就可能涉及被制裁的任何个人是否确为该受制裁的个人进一步查询；在一段合理时间内推迟处理该等资金划转或支付以进行百信银行认为必需的调查和查询；拒绝进行该等资金划转或支付或拒绝接受该等交易指令。</u></strong></p>\n<p><strong>5.</strong><strong>客户应妥善保管个人银行账户的交易密码、动态密码、个人有效身份证件、绑定账户、绑定手机号码及手机设备等，如因本人原因造成上述信息或设备出现遗失、泄露或被他人盗用的情况，已发生的损失由客户自行承担。</strong></p>\n<p><strong>6.</strong><strong>客户应按规定进行操作，客户未按规定使用支付电子工具、违规使用个人银行账户或者未支付结算服务费用的，百信银行有权停用直至撤销个人银行账户。</strong></p>\n<p><strong>7.</strong><strong>因不可抗力或供电、通讯、网络等非百信银行原因导致个人银行账户不能正常使用的，百信银行将视情况协助客户解决或提供必要的帮助，但不承担责任。对于在交易过程中，因暂时的网络通讯故障或其他原因造成的错账现象，百信银行有权根据实际交易情况进行账务处理。</strong></p>\n<p>8.客户不得出租、出借个人银行账户，不得利用个人银行账户套取银行信用。</p>\n<p>9.客户不得利用个人银行账户进行偷逃税款、逃废债务、套取现金、洗钱及其他违法犯罪活动。如客户存在洗钱、出卖银行账户等违法行为时，百信银行有权限制或终止服务。</p>\n<p>10.百信银行应依法保障客户的资金安全，并依法为客户的个人银行账户信息保密，除法律法规另有规定外，有权拒绝任何单位或个人对客户个人银行账户进行查询、冻结、扣划。</p>\n<p>11.百信银行应及时、准确地办理客户资金业务，按规定为客户提供账务查询、更改交易密码及更改手机号码等服务。</p>\n<p>12.在本协议履行过程中，客户向百信银行提供的百信银行不能从公共渠道取得的客户信息，均构成客户的保密信息，除根据法律法规及相关规定必须进行披露或双方另有约定的情形外，百信银行不得向任何第三方披露或许可使用该保密信息。</p>\n<p><strong>13.</strong><strong>客户授权百信银行，除法律法规另有规定之外，将客户提供给百信银行的信息、享受百信银行服务产生的信息(包括本授权条款签署之前提供和产生的信息)等，用于百信银行及其因服务必要而开展合作或委托的合作伙伴，为客户提供服务、推荐产品、开展市场调查与信息数据分析等。百信银行承诺自行并要求合作伙伴对上述信息严格保密，采取措施保护信息安全。</strong></p>\n<p>&nbsp;</p>\n<h2 style=\"text-align: center;\">第四条 其他约定</h2>\n<p><strong>1.</strong><strong>客户授权百信银行在发生以下情形时，百信银行有权对该个人银行账户采取限制措施，包括但不限于止付、止收、将账户状态改为未激活、解除绑定账户直至强制销户，相关责任及由此产生的损失均由客户承担：</strong></p>\n<p>（1）百信银行有证据证明该个人银行账户非客户本人开立的；</p>\n<p>（2）客户否认个人银行账户由本人开立；</p>\n<p>（3）绑定账户非客户本人账户；</p>\n<p>（4）客户未按规定使用支付电子工具、违规使用个人银行账户或者未支付电子或服务费用的，百信银行有权停用直至撤销其个人银行账户；</p>\n<p>（5）客户违反本协议开立或使用个人银行账户；</p>\n<p>（6）其他百信银行认为可能对账户安全性产生影响的情形。</p>\n<p>2.本协议签订地为中华人民共和国北京市xx区。本协议在履行期间发生的任何争议双方可以协商解决。协商不成的，均可向本协议签订地有管辖权的人民法院提起诉讼。</p>\n<p>3.本协议由百信银行负责制订、解释和修改，自页面显示开户完成且生成电子银行账号之日起生效，自销户之日起终止。</p>\n<p><strong>客户对上述情况有疑义的，可通过百信银行客户服务渠道提出复议要求。客户已理解并确认本协议中有关免除、限制百信银行责任的条款，客户同意百信银行有权根据国家法律法规及业务需要对本协议内容及个人银行账户使用规则进行调整，并同意该项调整将在百信银行正式渠道公告后按公告内容执行，无需另行通知客户。如客户在公告施行后继续使用个人银行账户，视为客户接受上述变更，双方无须另行签订书面协议；如客户不愿接受百信银行公告内容的，应在公告后及时申请终止相关服务。</strong></p>\n<p><strong>客户开户后使用百信银行服务还需遵守《百信银行服务协议》及《百信银行隐私政策》的相关规定。《百信银行服务协议》及《百信银行隐私政策》作为本协议的附件，与本协议一同生效，具有同等法律效力。</strong></p>\n<p><strong>客户确认：本人已认真阅读本协议，在完全理解本协议的情况下，同意本协议的全部内容。</strong></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '0', null);
INSERT INTO `cashcredit_agreement` VALUES ('2', '委托扣款协议', '<h1 style=\"text-align: center;\">委托扣款协议</h1>\n<p>客户：简称&ldquo;您&rdquo;或&ldquo;本人&rdquo;</p>\n<p>中信百信银行股份有限公司：简称&ldquo;本行&rdquo;或&ldquo;百信银行&rdquo;。</p>\n<p>您通过互联网(Internet)点击确认或以其他方式选择接受本协议，即表示您同意接受本协议的全部约定内容，确认承担由此产生的一切责任。</p>\n<p>一、您保证提供给本行的银行卡资料(包括：卡号、姓名、证件号码、手机号码等)为您本人持有的真实、完整、准确、合法、有效的银行卡信息，并同意本行将以上信息送至发卡银行进行核验。</p>\n<p>二、您同意并授权本行根据您所购买金融产品的金额、贷款还款金额、消费缴费金额等通过支付清算机构、第三方支付机构或发卡银行，从您提供的银行卡中扣款，届时该银行卡发卡银行无须事前另行通知您，且无需您向该银行卡发卡银行再次进行扣款授权。您承诺前述委托扣款视同您本人作出，不得向支付清算机构、第三方支付机构或发卡银行提出异议。</p>\n<p>三、您认可和同意：您发出的指令不可撤回或撤销，本行一旦根据您的指令委托支付清算机构、第三方支付机构或发卡银行从您提供的银行卡中划扣资金给收款人，您不应以非本人意愿交易或其他任何原因要求本行退款或承担其他责任。因您提供他人银行卡资料或虚假信息、您提供的银行卡账户余额不足或被挂失、冻结、销户等原因而引起的一切法律责任，由您自行承担，与本行无关。</p>\n<p>四、因支付清算机构、第三方支付机构或发卡银行原因导致扣款错误或延迟，给您造成损失的，由过错方承担责任，本行将协助您向其追究相应责任。</p>\n<p>五、您同意为完成扣款操作，本行有权合理使用并向支付清算机构、第三方支付机构或发卡银行披露本授权书全部内容及其他为完成扣款操作而必要的您的信息。</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><strong>客户确认：本人已认真阅读本协议，在完全理解本协议的情况下，同意本协议的全部内容。</strong></p>\n<p>&nbsp;</p>', '0', null);
INSERT INTO `cashcredit_agreement` VALUES ('3', '征信查询授权书（人行）', '<h1 style=\"text-align: center;\"><strong>征信查询授权书V1.1（人行征信版）</strong></h1>\n<p><strong>&nbsp;</strong></p>\n<p><strong>重要提示：</strong></p>\n<p><strong>为了保障您的合法权益，您应当阅读并遵守本授权书，请您务必审慎阅读、充分理解本授权书条款内容，特别是免除或者减轻百信银行（以下统称&ldquo;贷款人&rdquo;、&ldquo;贵行&rdquo;或&ldquo;被授权人&rdquo;）责任，或限制您权利的条款，其中免除或者减轻责任条款可能以加粗形式提示您注意。</strong></p>\n<p><strong>除非您已阅读并接受本授权书所有条款，否则您无权使用百信银行APP借款服务</strong><strong>。您的使用、登录等行为即视为您已阅读并同意本授权书条款的约束。</strong></p>\n<p><strong>&nbsp;</strong></p>\n<p>中信百信银行股份有限公司：</p>\n<p>本人<u>&nbsp;${customer_name}&nbsp;</u>（身份证号<u>&nbsp;&nbsp;${customer_idcard_no}&nbsp;&nbsp;</u>）向贵行作以下不可撤销的授权：</p>\n<p><strong>（1）贷款人在本人信贷业务申请阶段及业务存续期间，</strong><strong>按</strong><strong>照国家相关规定，</strong>通过中国人民银行个人信用信息基础数据库、或经国务院或其他政府有权部门批准合法设立的其他征信机构<strong>采集符合法律法规规定的本人个人信息及包括信贷交易信息（含本人在贷款人处办理业务时产生的不良信息）在内的信用信息，并可以向中国人民银行金融信用信息基础数据库、其他依法设立的征信机构提供以上信息。</strong></p>\n<p><strong>（2）贷款人可以根据国家有关规定，通过中国人民银行金融信用信息基础数据库、其他依法设立的征信机构、公安部公民身份信息数据库查询、打印、保存符合法律法规规定的本人个人信息和包括信贷信息在内的信用信息。</strong>用途如下：</p>\n<p>a.处理本人贷款申请与审批、贷后管理；</p>\n<p>b.处理本人提供担保的申请与审批、贷后管理；</p>\n<p>c.处理本人征信异议；</p>\n<p>d.依法或经有权部门要求；</p>\n<p>e.其他本人向贵行申请或办理的业务。</p>\n<p>（3）本人同意并不可撤销地授权合法成立的征信机构采集本人不动产的信息，并授权贵行向合法成立的征信机构核查本人提供的不动产信息。本人已被明确告知查询上述信息可能会给本人带来不利后果，但本人仍然同意合法成立的征信机构采集并向贵行提供这些信息。</p>\n<p><strong>&nbsp;</strong></p>\n<p>&nbsp;&nbsp; <strong>&nbsp;</strong><strong>授权人声明：</strong></p>\n<p><strong>本授权书是本人向百信银行做出的单方承诺，效力具有独立性，不因《借款额度合同》的任何条款无效而失效。</strong></p>\n<p>以上授权期限为本人作出本授权承诺之日起至本人在贷款人处所有业务终结之日止。<strong>您在贷款人处有借款额度但无借款余额的情况下，您与贷款人的业务关系仍然存续；若本人在贵行的全部借款额度到期后，本人在贵行仍有其他信贷业务未结清的，授权期限至本人在贵行的所有信贷业务结清之日止，贷款人仍有权向中国人民银行金融信用信息基础数据库查询、上报您的信用信息。</strong></p>\n<p><strong>若本人与被授权人发生任何纠纷或争议，首先应友好协商解决；协商不成的，本人同意将纠纷或争议提交被授权人（中信百信银行股份有限公司）有管辖权的人民法院管辖。本授权书适用中华人民共和国大陆地区法律。</strong></p>\n<p><strong>本人已知悉本授权书所有内容（特别是加粗字体内容）的意义以及由此产生的法律效力，自愿作出上述授权，本授权书是本人真实的意思表示，本人同意承担由此带来的一切法律后果。</strong></p>\n<p>本<strong>人知悉并理解上述授权内容和责任，本授权书及个人信息等资料同意由贷款人保留。</strong></p>\n<p><strong>特此授权！</strong></p>\n<p>&nbsp;</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>&nbsp;</p>\n<p>授权日期：&nbsp;${current_year} 年&nbsp;${current_month} 月&nbsp;${current_day} 日</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '0', null);
INSERT INTO `cashcredit_agreement` VALUES ('4', '征信查询授权书（外部非征信机构）', '<h1 style=\"text-align: center;\"><strong>个人信息使用授权书V1.0（外部数据版）</strong></h1>\n<p><strong>&nbsp;</strong></p>\n<p><strong>重要提示：</strong></p>\n<p><strong>为了保障您的合法权益，您应当阅读并遵守本授权书，请您务必审慎阅读、充分理解本授权书条款内容，特别是免除或者减轻百信银行（以下统称&ldquo;贷款人&rdquo;、&ldquo;贵行&rdquo;或&ldquo;被授权人&rdquo;）责任，或限制您权利的条款，其中免除或者减轻责任条款可能以加粗形式提示您注意。</strong></p>\n<p><strong>除非您已阅读并接受本授权书所有条款，否则您无权使用百信银行APP借款服务</strong><strong>。您的使用、登录等行为即视为您已阅读并同意本授权书条款的约束。</strong></p>\n<p><strong>&nbsp;</strong></p>\n<p>中信百信银行股份有限公司：</p>\n<p>本人<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </u>（身份证号<u>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ）</u>向贵行作以下不可撤销的授权：</p>\n<p><strong>贷款人在本人信贷业务申请阶段及业务存续期间，</strong><strong>按</strong><strong>照国家相关规定，</strong>通过其他有关机关或单位（包括但不限于公积金、社保、税务、民政等行政机关及事业单位、司法机关、监管部门、通讯运营商、物流、电子商务平台、中国互联网金融协会等行业自律组织、金融机构、互联网平台等第三方机构、资信评估机构或有关法律、监管机构许可机构等）的相关途径<strong>采集符合法律法规规定的本人个人信息及包括信贷交易信息（含本人在贷款人处办理业务时产生的不良信息）在内的信用信息，并可以向中国人民银行金融信用信息基础数据库、其他依法设立的征信机构提供以上信息。</strong></p>\n<p><strong>&nbsp;</strong></p>\n<p>&nbsp;&nbsp; <strong>&nbsp;</strong><strong>授权人声明：</strong></p>\n<p><strong>本授权书是本人向百信银行做出的单方承诺，效力具有独立性，不因《借款额度合同》的任何条款无效而失效。</strong></p>\n<p>以上授权期限为本人作出本授权承诺之日起至本人在贷款人处所有业务终结之日止。<strong>您在贷款人处有借款额度但无借款余额的情况下，您与贷款人的业务关系仍然存续；若本人在贵行的全部借款额度到期后，本人在贵行仍有其他信贷业务未结清的，授权期限至本人在贵行的所有信贷业务结清之日止，贷款人仍有权向中国人民银行金融信用信息基础数据库查询、上报您的信用信息。</strong></p>\n<p><strong>若本人与被授权人发生任何纠纷或争议，首先应友好协商解决；协商不成的，本人同意将纠纷或争议提交被授权人（中信百信银行股份有限公司）有管辖权的人民法院管辖。本授权书适用中华人民共和国大陆地区法律。</strong></p>\n<p><strong>本人已知悉本授权书所有内容（特别是加粗字体内容）的意义以及由此产生的法律效力，自愿作出上述授权，本授权书是本人真实的意思表示，本人同意承担由此带来的一切法律后果。</strong></p>\n<p>本<strong>人知悉并理解上述授权内容和责任，本授权书及个人信息等资料同意由贷款人保留。</strong></p>\n<p><strong>特此授权！</strong></p>\n<p>&nbsp;</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\n<p>&nbsp;</p>\n<p>授权日期：&nbsp;&nbsp;&nbsp; 年&nbsp;&nbsp; 月&nbsp;&nbsp; 日</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '0', null);
INSERT INTO `cashcredit_agreement` VALUES ('5', '个人借款额度合同', '<h1 style=\"text-align: center;\"><strong>个人借款额度合同</strong><strong>V1.0</strong></h1>\n<p><strong>合同编号：</strong></p>\n<p><strong>&nbsp;</strong></p>\n<p><strong>特别提醒：中信百信银行股份有限公司（以下简称&ldquo;贷款人&rdquo;） 将为您（亦称&ldquo;用户&rdquo;、&ldquo;本人&rdquo;）提供本合同项下的人民币贷款服务（以下简称本服务）。具体借款信息以本合同项下借款借据所载信息为准。借款借据是本合同组成部分之一，具有同等的法律效力。您在此确认并同意您与借款借据上所载的贷款人形成本合同项下的借款关系，受本合同约束。</strong></p>\n<p><strong>为了保障您的合法权益，您应当阅读并遵守&ldquo;借款额度合同&rdquo;（以下简称&ldquo;本合同&rdquo;），请您务必审慎阅读、充分理解各条款内容，特别是免除或者限制责任的条款，限制、免责条款可能以加黑加粗的形式提示您注意。</strong></p>\n<p><strong>除非您已阅读并接受本合同所有条款，否则您无权使用贷款服务。您的使用、登录或点击确认协议或以其他方式表示接受本协议等行为即视为您已阅读并同意接受本合同的约束,本合同即时生效。</strong></p>\n<p><strong>本合同由您和贷款人共同签署。</strong></p>\n<p>&nbsp;</p>\n<h2 style=\"text-align: center;\"><strong>第一条 定义及解释</strong></h2>\n<p>1.1除另有约定外，本合同中所涉及的部分名词解释如下：</p>\n<p><strong>&ldquo;个人消费贷款&rdquo;</strong>，是指您向贷款人申请，经贷款人审批并直接向您发放的以消费（不包括购买房屋和汽车）为目的的贷款。</p>\n<p><strong>&ldquo;额度&rdquo;</strong>：是指贷款人根据本合同为您提供的以个人信用为基础的贷款最高限额，您获得的额度并非是贷款人对您的贷款承诺，贷款人可根据您的资信情况及消费行为进行动态调整（上调或下调）或冻结，且无需另行通知甲方。</p>\n<p><strong>&ldquo;利率&rdquo;</strong>：是指贷款人发放贷款后，您需向贷款人支付的利息与贷款本金的比率。</p>\n<p><strong>&ldquo;费率&rdquo;</strong>：是指贷款人发放贷款后，您需向贷款人支付的手续费与贷款本金的比率。</p>\n<p><strong>&ldquo;还款日&rdquo;</strong>：是指双方约定的贷款人向您发放某笔贷款后您应按期归还贷款本息（按利率计息时适用）、本金与分期手续费（按费率计费时适用）、其他费用（如有）的日期。</p>\n<p><strong>&ldquo;受托支付&rdquo;：</strong>指贷款人根据您的支付委托，将贷款资金直接支付给符合约定用途的您的交易对象的支付方式。</p>\n<p><strong>&ldquo;自主支付&rdquo;</strong>：指贷款人根据您的提款申请将贷款资金直接发放到您的账户，并有您自主支付给符合约定用途的交易对象的支付方式。</p>\n<p><strong>&ldquo;逾期&rdquo;：</strong>是指您未按照约定的还款日向贷款人足额偿还已到期款项。</p>\n<p><strong>&ldquo;法律法规&rdquo;：</strong>包括中华人民共和国的法律、行政法规、最高人民法院的司法解释以及金融监管机构的规章、规定与命令、通知等。</p>\n<p><strong>&ldquo;本合同&rdquo;</strong>：包括您与贷款人签署的本《个人借款额度合同》及借据等附件，亦包括后续对该合同及附件的任何有效修订和补充。</p>\n<p><strong>&ldquo; 贷款人线上服务平台&rdquo;</strong>：指您向贷款人提出贷款审批、查看额度、申请借款等操作的在线或移动平台，包括但不限于百信银行APP、企业服务号、官方微信公众号等。</p>\n<p>&ldquo;<strong>授信额度有效期&rdquo;：指在授信额度内，您可向贷款人申请贷款的期限。本合同初始授信额度有效期为自本合同生效之日起*个月；授信额度有效期届满前，若本合同双方均无异议，可从到期之日起自动展期*年，展期次数不限。</strong></p>\n<p><strong>&ldquo;可使用授信额度&rdquo;</strong>：是指当期您可以使用的额度。可使用额度＝授信额度－额度项下您已经支取且尚未结清的单笔借款发放本金之和。</p>\n<p><strong>&ldquo;提款申请&rdquo;</strong>：您应向贷款人发出提款的支付申请，逐笔向贷款人申请提取贷款资金。贷款人有权根据您的风险状况或经营情况调整您使用贷款的提款（支付）限额（包括但不限于当日可发放总规模限额、单笔限额、每日限额和每月限额）及提款笔数。</p>\n<p><strong>&ldquo;还款账户&rdquo;：</strong>指您申请、使用本贷款服务，提供给贷款人发放贷款的银行账户，及您在百信银行开立的账户。</p>\n<p><strong>&ldquo;代扣还款&rdquo;：指</strong><strong>为偿还本合同项下应付款项的目的，您无条件不可撤销地同意并授权贷款人代您持续向还款账户开户行、有权的第三方支付清算机构，包括但不限于银联等卡组织、人行清算组织机构等机构（以下统称&ldquo;第三方支付机构组织&rdquo;）发送代扣指令，直接将您还款账户的款项划扣至贷款人账户，用于偿还您在贷款人处全部债务直至清偿完毕，且贷款人有权将同一还款日的多笔贷款应还款额合为一笔或分成特定金额，分笔、分批发出交易委托指令。您承诺前述交易委托指令视同您本人做出。代扣时间、金额等指令以贷款人通知为准。</strong></p>\n<p><strong>本合同中的贷款、借款为同一含义。</strong></p>\n<h2 style=\"text-align: center;\"><strong>第二条 基本信息</strong></h2>\n<p><strong>借款人姓名：</strong></p>\n<p><strong>证件类型：</strong></p>\n<p><strong>证件号码：</strong>&nbsp;</p>\n<p><strong>手机号码：&nbsp;</strong></p>\n<p><strong>合同签署日期：</strong>&nbsp;</p>\n<p><strong>合同签订地：</strong></p>\n<p>为了保护借款人的个人信息安全，本协议在展示时部分隐藏了借款人的身份信息，借款人知晓并同意，本协议项下借款人的身份信息以您在贷款人线上服务平台后台所留存的信息为准。</p>\n<p><strong>&nbsp;</strong></p>\n<p>&nbsp;</p>\n<h2 style=\"text-align: center;\"><strong>第三条 申请及信息授权</strong></h2>\n<p>3.1<strong>您须亲自通过贷款人线上服务平台向贷款人提出借款申请，手机验证码与交易密码共同视为证明您真实身份的重要凭据，所有通过验证时发送至您在业务平台预留手机号码的手机验证码而确认的指令或通过验证的交易密码，均视为您本人申请。</strong></p>\n<p>3.2您应妥善保管您的常用手机设备（含手机号码）、百信银行APP交易密码等信息，您应确保不向任何人泄露您以上信息。<strong>对于因账号、密码泄露所致的损失，由您自行承担。如您发现有他人冒用或盗用您的账号及密码申请本贷款业务的，您应立即以有效方式通知贷款人，要求贷款人暂停本服务。您应及时更新您再业务平台预留的手机号码信息。您未能及时更新您在业务平台预留的手机号码而引致的后果，均由您自行承担。同时，您理解贷款人对您的请求采取行动需要合理期限，在此之前，贷款人对已执行的指令及(或)所导致的您的损失不承担任何责任。</strong></p>\n<p>3.3<strong>您保证向贷款人提供的所有申请信息是真实、完整、准确、合法、有效的，并授权百信银行向有关机构或单位（包括但不限于中国人民银行个人信用信息基础数据库、合法的征信机构、公安机关、公积金、社保、税务、民政等）查询或确认与您借款申请相关信息。</strong></p>\n<p>3.4百信银行承诺根据监管要求对客户资料承担保密义务,不得将收集到的用户相关信息提供给贷款人以外的无关的第三方，但贷款人之间就用户相关信息的使用除外。<strong>您同意，百信银行可以向中国人民银行金融信用信息基础数据库、其他依法设立的征信机构、关联公司查询您使用本服务所必要的个人身份信息及信用信息（包括不良信息）。</strong></p>\n<p><strong>3.5</strong><strong>您同意并授权百信银行可以记录并储存您访问贷款人线上服务平台的应用程序及相关网站、页面时的操作日志，包括但不限于您的终端IP地址、设备标识符、硬件型号、操作系统版本、您的位置以及与本服务相关的日志信息。</strong></p>\n<p><strong>3.6 </strong><strong>为确保业务平台及您的信息安全性，贷款人有权基于法律法规许可及您的授权获得的数据，对您在任何时候登陆业务平台的设备进行可信度判断，并基于贷款人独立判断限制登陆业务平台，或者要求您通过其他方式验证该设备的可信度后才允许您登陆业务平台并使用相关服务。您理解并同意，贷款人对于设备可信度的判断建立在合理且技术可实现的基础上，并无须为此承担任何责任。</strong></p>\n<p><strong>3.7</strong><strong>贷款</strong><strong>人有权依据您的资信情况综合自主决定是否受理您的借款申请及</strong><strong>核定您的信用额度，且在核定您的信用额度后，贷款人有权根据掌握的您的信用情况或认定的风险控管因素或其他正当理由，随时调整您的信用额度（包括但不限于调低、调高或者中止、终止）。</strong></p>\n<p><strong>3.8</strong><strong>贷款人核定的您的信用额度并不构成贷款人对您的授信承诺，信用额度项下具体提款业务，您应逐笔在授信额度有效期内及可使用授信额度内向贷款人申请提款，贷款人有权根据您的当期信用及贷款人当期可贷款资金规模自主决定是否向您发放额度项下单笔贷款以及具体贷款金额。</strong></p>\n<p>&nbsp;</p>\n<h2 style=\"text-align: center;\"><strong>第四条 额度的使用、提款</strong></h2>\n<p>4.1 您应保证在安全环境下通过各种媒介使用本信用额度，否则您须对非安全环境下本信用额度在互联网或其它媒介上使用所导致的风险和损失自行负责。</p>\n<p>4.2<strong>您知悉贷款人通过贷款业务平台校验交易密码对使用本额度的交易进行身份验证，并同意任何通过密码校验成功产生的交易均为其本人交易，并由您承担相应的交易后果。您应确保妥善保管并不向任何人泄露交易密码，对于因密码泄露所致的损失，由您自行承担。您电子确认的交易凭证以及依据交易密码等电子数据信息办理的各类结算交易和信用额度提取、还款交易所产生的电子信息记录，均视为该项交易的有效凭证。</strong></p>\n<p><strong>4.3</strong><strong>本额度项下单笔贷款金额以经您确认的电子借据所载信息为准。</strong>以电子借据约定的贷款起始日为起息日/计费起始日，若无电子借据，则以贷款人系统生成的电子信息记录（包括但不限于额度提取记录、计算记录、还款记录等，下同）记载的为准。贷款利率、分期手续费费率、一次性贷款服务费等按借据的约定计算，若无借据，则以贷款人系统生成的电子信息记录记载为准。</p>\n<p>4.4本信用额度项下单笔贷款不能用于个人购买住房、进行证券投资<strong>或用于股本权益性投资贷款资金、不得用于期货等投机经营或从事其他违法、违规交易</strong>，否则视同违约。</p>\n<p>4.5贷款支付方式：本合同项下贷款支付方式分为受托支付和自主支付。贷款人有权根据借款用途和支付的具体金额决定贷款的支付方式。</p>\n<p>4.6本额度项下单笔贷款采用自主支付的，贷款人根据您的提款申请将贷款资金直接发放到您的账户上，并由您通过取现、转账、支付等方式自主支付给符合日常消费用途的交易对象，单笔提款金额必须≧500元,且为100的整数倍。贷款人有权变更您对本额度的自主支付提款次数及单笔提款金额上限与下限，<strong>并且无需另行通知您。</strong></p>\n<p>采用自主支付的，您应定期报告或告知贷款人贷款资金支付情况，贷款人有权通过账户分析、凭证查验、现场调查等方式核查贷款支付是否符合约定用途。</p>\n<p>4.7本额度项下单笔贷款采用受托支付的，贷款人根据您发出的网络消费交易的支付指令，逐笔将贷款资金支付给服务提供商。贷款人完成上述受托支付后即视为贷款人已完成对您的贷款发放。</p>\n<p>4.8<strong>您</strong><strong>不得利用本信用额度进行偷逃税款、逃废债务、套取现金、洗钱及其他违法犯罪活动，</strong><strong>若您在使用本信用额度过程中出现监管机关规定的或贷款人依其主观判断认定的风险特征时，贷款人有权不经任何形式的事先通知或事先确认而随时中止或终止您对本信用额度的使用，您有义务积极协助贷款人识别相关风险，并承担因此所产生的损失。</strong></p>\n<p><strong>4.9 </strong><strong>除非有确实且充分的相反证据，否则贷款人系统生成的电子记账凭证、流水记录等是本合同项下贷款发放及款项偿还情况的有效证据。</strong></p>\n<p>&nbsp;</p>\n<h2 style=\"text-align: center;\"><strong>第五条 利率</strong></h2>\n<p>5.1</p>\n<p>5.2<strong>您使用本额度项下贷款时，贷款人将自贷款成功发放之日（从贷款人处转出）起计收利息至清偿日止，单笔贷款利率将在您的提款过程中经您确认的电子借据为准。</strong></p>\n<p>5.3<strong>贷款人有权修改或新增利息收取标准，标准修改或新增后将在贷款人提供的电子服务平台进行公告，若您不同意修改或新增费用项目或标准，可停止申请新的贷款，您之前申请的贷款利息标准不受影响。</strong></p>\n<p>5.4单笔贷款期限自贷款成功发放之日起开始计算，发放日期、到期日期、还款日以您确认的电子借款借据信息为准。由于每笔贷款的发放日期不同，借款期限并非一个整自然月。</p>\n<p>&nbsp;</p>\n<h2 style=\"text-align: center;\"><strong>第六条 对账和还款</strong></h2>\n<p>6.1您应主动查询您账户信用额度的交易明细以确认交易内容。<strong>贷款人所保存的本信用额度项下的交易记录，均为本额度使用的真实凭据，对您具有约束力。您不得以未收到对账单或未看到交易明细为由否认额度资金使用行为或交易款项。 </strong></p>\n<p>6.2 除另有约定外，本合同项下贷款的还款方式为下述方式的其中之一，具体详见贷款的电子借据：</p>\n<p>（1）按月等额本息还款（每月等额）：即按贷款人的要求，每月以固定金额偿还贷款本息，贷款到期日归还剩余本金和利息。</p>\n<p>（2）按月等额本金还款：即按贷款人的要求，每月以固定金额偿还贷款本金，并偿付当月实际产生的利息，贷款到期日归还剩余本金和利息。每期还款金额＝贷款本金/贷款期数 + （贷款本金-累计已还本金）&times;贷款日利率&times;当期实际天数。</p>\n<p>（3）按月付息，到期还本（先息后本）：即每月偿付当月实际产生的利息，贷款到期日归还全部贷款本金及剩余利息。</p>\n<p>（4）到期一次性还本付息：即贷款到期日一次性归还贷款本金及相应利息。</p>\n<p>6.3 您应在每期贷款的还款日前归还当期应还款金额，首期还款日期以您提款过程中经您电子确认的电子借据为准，还款日的规则如下：</p>\n<p>（1）单一客户额度项下所有单笔贷款每月还款日固定，该固定还款日统一为首笔贷款确定的每月还款日；</p>\n<p>（2）首笔贷款发放日为1～28日的，每月还款日为贷款发放日的对应日，贷款到期日为最后一次还款日，利随本清；首笔贷款发放日为当月29、30、31日的，每月还款日为15日至28日某一日，具体日期以系统登记为准，贷款最终到期日统一为最后一期还款日，利随本清；</p>\n<p>（3）非首笔贷款的首次还款日为从该笔贷款发放日起(含)的第二个每月还款日。</p>\n<p>6.4 您可以选择主动还款或自动还款服务完成贷款归还：</p>\n<p><strong>（1）主动还款：您可主动向贷款人偿还借款本息及相关费用。</strong></p>\n<p><strong>（2）自动还款（委托代扣服务）：您需在约定的还款日前一天将应还款项足额存入您的还款账户，您不可撤销地授权贷款人委托还款账户开户行及第三方支付机构组织从您的还款账户中扣收本合同项下的贷款本息、贷款人对您的代垫费用及其他相关费用。您承诺前述交易委托指令视同您本人作出。代扣时间、金额等指令以贷款人通知为准，代扣的全部责任由您与贷款人承担。</strong></p>\n<p>（3）您承诺在使用委托代扣或主动还款服务时，您的承诺和指令均遵守国家法律、法规和本协议目的且不侵犯财付通和深结等第三方支付组织机构、贷款人及其他第三方的合法权益，否则，相关机构有权立即单方面终止提供本服务，并不承担任何责任。</p>\n<p>（4）您在此确认和授权，当您的账户余额不足时，贷款人有权降低代扣额度以及多次分笔通过还款账户开户行或第三方支付机构组织发出代扣指令。</p>\n<p>（5）若因各种原因（包括但不限于还款账户余额不足）造成自动扣款失败，逾期未清偿任何款项将影响您的征信记录。</p>\n<p>6.5 <strong>还款顺序：贷款人扣收款项按照先前期、后当期和先费用、利息、后本金的顺序进行，但贷款人有权根据您的信用状况和贷款人的风险政策单方面变更前述扣款顺序，而无需另行通知您。</strong></p>\n<p>6.6 在您未清偿所有贷款费用、本金及利息前，您不得变更、注销您的还款账户，特殊情况除外。如遇特殊情况，经贷款人审批后可变更您的还款账户，但贷款功能会受到限制。</p>\n<p>6.7 <strong>您有权申请提前结清，但在借款当日不能提前结清。当有多笔未结清贷款时，贷款人有权限定您提前结清的借据顺序及金额下限，具体以贷款人受理您的提前还款申请后的终审结果为准。</strong>贷款人免收提前还款违约金。</p>\n<p><strong>&nbsp;</strong></p>\n<h2 style=\"text-align: center;\"><strong>第七条 合同变更、解除、权利义务的转让</strong></h2>\n<p>7.1&nbsp; 合同变更与解除</p>\n<p><strong>（1）贷款人有权随时单方面修改本合同中与您相关的权利义务，但相关修改不得加重您在贷款金额和利（费）率方面的责任。一旦合同条款变更，贷款人将在本贷款电子服务平台进行公示，除法律法规或监管规定另有强制性规定外，经修订的内容一经公示，立即生效。若您不同意修改本合同，则应当自该等告示之日起立即停止使用本服务并全额还清本合同项下的应付款项；否则，视为您同意并接受修改后的合同。</strong></p>\n<p><strong>（2）本合同生效后，除本合同另有约定外，您不得要求单方擅自变更或解除本合同。贷款人有权基于自身经营考虑，随时宣布中断、终止本合同或其任何部分，并要求您在指定期限内偿还本合同项下应付款项。</strong></p>\n<p><strong>7.2 </strong><strong>合同权利义务的转让 </strong></p>\n<p><strong>未经贷款人书面同意，您不得将本合同项下的权利和义务转让给任何第三方。贷款人有权将其在本合同项下的权利和义务全部或部分转让给第三方，且转让行为无须征得您的同意，贷款人将通知您该等转让行为。</strong></p>\n<p><strong>&nbsp;</strong></p>\n<h2 style=\"text-align: center;\"><strong>第八条 违约条款</strong></h2>\n<p><strong>8.1 </strong><strong>下列任一事件均构成本条款所称违约事件：</strong></p>\n<p><strong>（1）您未按双方约定的用途使用贷款或将资金用于禁止领域；</strong></p>\n<p><strong>（2）您拖欠本金或利息、费用；</strong></p>\n<p><strong>（3）您在履行与贷款人或其他金融机构签订的其他合同时有违约行为；</strong></p>\n<p><strong>（3）您未履行本合同下任何义务的行为；</strong></p>\n<p><strong>（4）您向贷款人提供虚假的信息；</strong></p>\n<p><strong>（6）您转移资产以逃避债务的；</strong></p>\n<p><strong>（7）您发生严重影响偿债能力的情形。</strong></p>\n<p><strong>8.2 </strong><strong>有违约事件发生时，贷款人有权采取下列措施：</strong></p>\n<p><strong>（1）要求您限期纠正违约行为；</strong></p>\n<p><strong>（2）停止发放您尚未使用的贷款；</strong></p>\n<p><strong>（3）要求您提前归还已发放的全部贷款本金并结清利息；</strong></p>\n<p><strong>（4）根据贷款风险状况调整贷款金额、期限与利率；</strong></p>\n<p><strong>（5）宣布本合同项下您未偿还的贷款提前到期，委托还款账户开户行或第三方支付机构组织从您的还款账户中扣除相应金额以收回相关费用、罚息、复利、贷款本息，或以合法手段追偿您应付款项；</strong></p>\n<p><strong>（6）从您在贷款人任何营业机构开立的账户中扣收您应偿付的贷款本金、利息、罚息、复利以及所有其他应付费用；</strong></p>\n<p><strong>（7）对您的违约行为，可以公开披露；</strong></p>\n<p><strong>（8）采取法律、法规规定的其他救济措施。</strong></p>\n<p><strong>8.3</strong><strong>您任何一期未及时足额归还借款本息即视为逾期，</strong><strong>从逾期之日起对逾期贷款金额按本合同项下借据中约定的利率加收50%计收罚息，直至清偿逾期本息为止；对不能按时支付的利息，贷款人有权按罚息利率计收复利。</strong></p>\n<p><strong>您未按各具体合同约定用途使用贷款的，贷款人有权对其违约使用部分贷款按日在约定执行利率水平上加收100%计收罚息，直至贷款本息清偿完毕为止。</strong></p>\n<p><strong>8.4</strong><strong>您同意贷款人有权在进行催收和追索债务等工作时，将您的身份信息、联络信息及您拖欠本合同项下债务的相关信息提供给第三方（包括律师事务所和催收机构）；且贷款人将督促该等第三方妥善保管、保密和谨慎使用前述信息，不得用作委托催收和追索债务以外的其他用途，以及不得以任何违法的方式进行催收和追索债务。</strong></p>\n<p><strong>8.5</strong><strong>贷款人因向您催收欠款及实现债权而产生的一切费用（包括但不限于公证费、诉讼费、律师费、差旅费），均由您承担。</strong></p>\n<p><strong>8.6</strong><strong>贷款人软（硬）件系统出现下列任一状况而无法正常运作，致使无法向您提供本服务，贷款人均不承担任何违约或赔偿责任，该状况包括但不限于： </strong></p>\n<p><strong>(1)</strong><strong>在本服务网站维护期间。</strong></p>\n<p><strong>(2)</strong><strong>电信设备出现故障不能进行数据传输的。 </strong></p>\n<p><strong>(3)</strong><strong>因台风、地震、海啸、洪水、停电、战争、恐怖袭击等不可抗力之因素，造成本服务运行系统障碍不能执行业务的。 </strong></p>\n<p><strong>(4)</strong><strong>由于黑客攻击、电信部门、还款账户开户行和其他第三方支付机构组织有信息技术依赖的相关部门、企事业单位技术调整或故障、网站升级等原因而造成的服务中断或者延迟。</strong></p>\n<p>&nbsp;</p>\n<h2 style=\"text-align: center;\"><strong>第九条 附则</strong></h2>\n<p>9.1 贷款人线上服务平台所公布的服务收费标准、单笔借据及电子补充协议、附件是本协议不可分割的部分，与本协议具有同等法律效力。</p>\n<p>9.2您在向贷款人提供的资料及信息（包括但不限于姓名、国籍、住所地、工作单位、联系电话、身份证件或者身份证明文件的号码、有效期等身份信息）发生变更的，应在信息发生变更之日起7日内通过贷款人提供的线上服务平台更新相关信息；贷款人就本协议给予其他方的任何通知、要求或其它函件，一经发送到您向贷款人提供的信息中所示的地址，即视为已送达，因您不及时变更信息而引起的责任及产生的损失，由您自行承担，贷款人有权因此停止为您发放新的贷款。</p>\n<p><strong>9.3 </strong><strong>管辖及法律适用</strong></p>\n<p><strong>（1）本合同签订地为中华人民共和国北京市。<br /> （2）本合同的成立、生效、履行、解释及纠纷解决，适用中华人民共和国大陆地区法律（不包括冲突法）。<br /> （3）若您和贷款人之间发生任何纠纷或争议，首先应友好协商解决；协商不成的，您同意将纠纷或争议提交本合同签订地有管辖权的人民法院管辖。<br /> （4）本合同条款无论因何种原因部分无效或不可执行，其余条款仍有效，对双方具有约束力。</strong></p>\n<p><strong>（5）您认同已电子数据形式提交、确认或签署任何法律性文件的方式及法律效力，且认可贷款人电子数据的有效性和证据效力。贷款人相关系统所产生和保留记载的相关电子数据及交易记录，以及贷款人制作或保留的相关电子及纸质单据、凭证、记录等相关资料，均构成有效证明合同双方权利义务关系的确定证。</strong></p>\n<p><strong>（6）本合同及本合同项下电子补充协议或附件（如有）已经经过第三方存证机构进行电子固化并保存，可以作为争议解决中的证据使用。</strong></p>\n<p><strong>（7）本合同最终解释权归中信百信银行股份有限公司。</strong></p>\n<p><strong>&nbsp;</strong></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>', '1', null);
INSERT INTO `cashcredit_agreement` VALUES ('6', '个人借款借据凭证', '个人借款借据凭证V1.0借据编号：特别提醒：为保障您的合法权益，请在签署本借据前，务必审慎阅读、充分理解各条款内容，特别是免除或者限制责任的条款，限制、免责条款可能以加黑加粗的形式提示您注意。本借据经您点击“确认”即视为您已完全理解并同意全部条款（包括有关权利义务和/或责任限制、免责条款），并视为本借据已由双方签署生效。若本借据内容与您签署的个人借款额度合同内容不一致的，以本借据为准。本借据为约定的事项，以该个人借款额度合同约定为准。', '1', null);
